import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'backOffice';
}
<app-navbar></app-navbar>
<router-outlet></router-outlet>
<button type="button" class="btn btn-primary" routerLink="add">Grupos</button>
<button type="button" class="btn btn-primary" routerLink="add">Usuarios</button>
<button type="button" class="btn btn-primary" routerLink="add">Tickets</button>
<button type="button" class="btn btn-primary" routerLink="add">Productos</button>
